import React, { useEffect, useState } from "react";
import { SERVER_URL } from "../constants.js";
import Card from "@mui/material/Card";
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
} from "@mui/material";
import Button from "@mui/material/Button";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import "../index.css";
import ResponsiveAppBar from "./ResponsiveAppBar.js";
import Footer from "./Footer.js";
import CardMedia from "@mui/material/CardMedia";
import ResponsiveAppBarNotConnected from "./ResponsiveAppBarNotConnected.js";
import RatingStars from "./RatingStars.jsx";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";
import IconButton from "@mui/material/IconButton";
import SearchIcon from "@mui/icons-material/Search";

import Box from "@mui/material/Box";
import Input from "@mui/material/Input";
export default function PrestataireList() {
  const [prestataires, setPrestataires] = useState([]);
  const [recomment, setComment] = useState([]);
  const [searchTerm, setSearchTerm] = useState(""); 
  const [selectedValue, setSelectedValue] = useState("");
  useEffect(() => {
    fetchPrestataires();
  }, []);
  const [open, setOpen] = useState(false);
  const fetchPrestataires = () => {
    fetch(SERVER_URL + "prestataires")
      .then((response) => response.json())
      .then((data) => setPrestataires(data))
      .catch((err) => console.error(err));
  };
    const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
    };
    const handleClickSelect = (event) => {
    setSelectedValue(event.target.value);
  };

  const fetchComments = (id) => {
    fetch(SERVER_URL + `prestataires/reviews/${id}`)
      .then((response) => response.json())
      .then((data) => setComment(data))

      .catch((err) => console.error(err));
  };
  const [selectedEvent, setSelectedEvent] = useState(null);

  const handleClose = () => {
    setOpen(false);
  };
  const handleClickEvent = (event) => {
    setSelectedEvent(event);
    setOpen(true);
  };
  const tabImage = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRZrrLnJjAYXC7hRf-xtUsrpMaY8NHMLMkMCQ&usqp=CAU",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGQOyd9Dr_5YABBNow4DGtoxN29ZqJ0KZx_BBaBV0fTnY62v3ApKGWMy_B_PEGDXUpEG4&usqp=CAU",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];
  return (
    <>
      {sessionStorage.getItem("isLoggedIn") ? (
        <ResponsiveAppBar />
      ) : (
        <ResponsiveAppBarNotConnected />
      )}
      <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <Input
              color="primary"
              disabled={false}
              placeholder="Rechercher un service"
              size="md"
              variant="solid"
              onChange={handleSearchChange}
              sx={{ marginRight: 2, marginLeft: 2 }}
              endAdornment={
                <IconButton
                  color="primary"
                  size="small"
                  icon={<SearchIcon />}
                />
              }
            />

            <Select
              color="primary"
              placeholder="Trier par événement ..."
              size="sm"
              value={selectedValue}
              onChange={handleClickSelect}
              // sx={{ marginRight: "auto", flexShrink: 0 }}
              defaultValue="Tous les prestataires"
              sx={{
                marginRight: "auto",
                flexShrink: 0,
                maxWidth: "3000px",
                maxHeight: "30px",
              }}
            >
              <MenuItem value="">Tous les prestataires</MenuItem>
              {prestataires.map((event) => (
                <MenuItem key={event.service} value={event.service}>
                  {event.service}
                </MenuItem>
              ))}
            </Select>
          </Box>
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {prestataires.filter((event) =>
          event.service.toLowerCase().includes(searchTerm.toLowerCase())
        ).filter((event) =>
          event.service.toLowerCase().includes(selectedValue.toLowerCase())
        ).map((prestataire) => (
          <Card key={prestataire.id} style={{ margin: "16px", width: 300 }}>
            <CardMedia
              component="img"
              height="200"
              image={
                prestataire.photo == null
                  ? tabImage[Math.floor(Math.random() * tabImage.length)]
                  : `${SERVER_URL}` + `prestataires/${prestataire.photo}`
              }
              alt={prestataire.nom}
            />
            <CardContent>
              <Typography variant="h6" component="div">
                {prestataire.prenom} {prestataire.nom}
              </Typography>

              <Typography variant="body2" color="text.secondary">
                email : {prestataire.mail}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                service : {prestataire.service}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {prestataire.note ? (
                  <div>
                    <RatingStars rating={prestataire.note} />
                  </div>
                ) : (
                  ""
                )}
              </Typography>
              <button
                className="profile-card__button button--blue js-message-btn "
                onClick={() => {
                  handleClickEvent(prestataire);
                  fetchComments(prestataire.idp);
                  console.log(recomment);
                }}
              >
                Voir les Commentaires{" "}
              </button>
            </CardContent>
          </Card>
        ))}
        {selectedEvent && (
          <Dialog open={open} onClose={handleClose} fullWidth maxWidth="md">
            <DialogTitle>Les avis sur {selectedEvent.nom} {selectedEvent.prenom}</DialogTitle>
            <DialogContent>
              {/* <table> */}
              {recomment.map((c) => (
                <h2>
                  {c.emailClient} dit : {c.comment}{" "}
                </h2>
              ))}

              {/* </table> */}
            </DialogContent>
            <DialogActions>
              <Button
                className="profile-card__button button--orange "
                variant="contained"
                onClick={handleClose}
              >
                Fermer
              </Button>
            </DialogActions>
          </Dialog>
        )}
      </div>
      {/* <br></br><br></br><br></br> */}
      <Footer />
    </>
  );
}
